import styled from "styled-components";

const Placeholder = styled.div`
	text-align: center;
`;

function Index() {
	return (
		<Placeholder>
			<img src="https://cdn-images-1.medium.com/max/222/1*CAL6MRkz-KF6U2oZY4JWJg@2x.png" />
		</Placeholder>
	);
}

export default Index;
